// ==UserScript==
// @author         Whomiga
// @id             portaldetailsmod@Whomiga
// @name           Portal Detail Mods
// @category       Info
// @version        0.0.1
// @description    Show Mod Pictures in Portal Details
// @downloadURL    https://raw.githubusercontent.com/IITC-CE/Community-plugins/master/dist/Whomiga/portaldetailsmod.user.js
// @updateURL      https://raw.githubusercontent.com/IITC-CE/Community-plugins/master/dist/Whomiga/portaldetailsmod.meta.js
// @match          *://intel.ingress.com/*
// @grant          none
// ==/UserScript==


function wrapper(plugin_info) {

    // Make sure that window.plugin exists. IITC defines it as a no-op function,
    // and other plugins assume the same.
    if (typeof window.plugin !== "function") window.plugin = function () {};

    window.plugin.PortalDetailMods = function () {};
    var self = window.plugin.PortalDetailMods;
    self.id = 'PortalDetailMods';
    self.title = 'PortalDetailMods';
    self.version = '0.0.1.20250930.203000';
    self.author = 'Whomiga';

    // Name of the IITC build for first-party plugins
    plugin_info.buildName = "PortalDetailMods";

    // Datetime-derived version of the plugin
    plugin_info.dateTimeVersion = "20250930.200030";

    // ID/name of the plugin
    plugin_info.pluginId = "portalDetailMods";

    self.namespace = 'window.plugin.' + self.id + '.';
    self.pluginname = 'plugin-' + self.id;

//
// Settings
//
    const KEY_SETTINGS = "plugin-portaldetailmods";
    self.settings = {
        imageMode: 'original',
    };

//
// Type of OS/Browser
//    
    function isMobile() {
        return (typeof android !== "undefined" && !!android);
    }

    function isiOS() {
        return (/iPad|iPhone|iPod/.test(navigator.userAgent) && !window.MSStream);
    }

    function isFirefox() {
        return (/Firefox/i.test(navigator.userAgent));
    }

//
// Mods Related Functions & Definitions
//
    function mods_getImageByKey(key, imageMode) {
        const prefix = "data:image/png;base64,"

        // All Images Should Be 64 Pixels Wide With A Minimum Height of 64
        // and a Maximum Height of 70 Pixels
        // Use: https://base64.guru/converter/encode/image/png for conversion
        //
        var item_PrimeModImages = {
// Multi-Hacks
            "COMMON_MULTI-HACK":    "",
            "RARE_MULTI-HACK":      "",
            "VERY_RARE_MULTI-HACK": "",
// Heat Sinks
            "COMMON_HEAT_SINK":    "",
            "RARE_HEAT_SINK":      "",
            "VERY_RARE_HEAT_SINK": "",
// Link Amps
            "RARE_LINK_AMP":      "",
            "VERY_RARE_LINK_AMP": "",
// Premium Portal Mods
            "VERY_RARE_SOFTBANK_ULTRA_LINK": "",
            "VERY_RARE_ITO_EN_TRANSMUTER_(+)": "",
            "VERY_RARE_ITO_EN_TRANSMUTER_(-)": "",
// Shields
            "COMMON_PORTAL_SHIELD":    "",
            "RARE_PORTAL_SHIELD":      "",
            "VERY_RARE_PORTAL_SHIELD": "",
            "VERY_RARE_AEGIS_SHIELD":  "",
// Protection
            "RARE_TURRET": "",
            "RARE_FORCE_AMP": "",
        };

        var item_OriginalModImages = {
// Multi-Hacks
            "COMMON_MULTI-HACK":    "",
            "RARE_MULTI-HACK":      "",
            "VERY_RARE_MULTI-HACK": "",
// Heat Sinks
            "COMMON_HEAT_SINK": "",
            "RARE_HEAT_SINK": "",
            "VERY_RARE_HEAT_SINK": "",
// Link Amps
            "RARE_LINK_AMP": "",
            "VERY_RARE_LINK_AMP": "",
// Premium Portal Mods
            "VERY_RARE_SOFTBANK_ULTRA_LINK": "",		
            "VERY_RARE_ITO_EN_TRANSMUTER_(+)": "",
            "VERY_RARE_ITO_EN_TRANSMUTER_(-)": "",
// Shields
            "COMMON_PORTAL_SHIELD": "",
            "RARE_PORTAL_SHIELD": "",
            "VERY_RARE_PORTAL_SHIELD": "",
            "VERY_RARE_AEGIS_SHIELD": "",
            "VERY_RARE_AXA_SHIELD": "",
// Protection
            "RARE_TURRET": "",
            "RARE_FORCE_AMP": "",
		};
		if (imageMode == 'prime') {
            result = prefix + item_PrimeModImages[key];
        }
        else {
            result = prefix + item_OriginalModImages[key];
        }
        return result;
    }

// 
// Settings Dialog
//
    function dialog_ShowSettings() {
        let dialog_id = 'portaldetailmods';
        let dialog = dialog_GetDialog(dialog_id);
        if (dialog && dialog.dialog('isOpen')) {
            dialog.dialog('close');
            return;
        }
        var dialogButtons = {
            'OK': function () { $(this).dialog('close'); }
            }

        let container = document.createElement('div');
        container.id = 'portaldetailsmods';
        let settings = container.appendChild(document.createElement('div'));
        settings.className = "settings";
//
//  Settings
//
        let table = settings.appendChild(document.createElement('table'));
        let tablebody = table.appendChild(document.createElement('tbody'));
        let imagemoderow = tablebody.appendChild(document.createElement('tr'));
        let imagerowarea = imagemoderow.appendChild(document.createElement('td'));
        imagemodelabel = imagerowarea.appendChild(document.createElement('label'));
        imagemodelabel.textContent = 'Image mode:';
        imagemodelabel.style.display = 'inline-block';
        imagemodelabel.for = "portaldetailmods-settings--imagemode";
        let imagemodeselect = imagerowarea.appendChild(document.createElement('select'));
        imagemodeselect.id = 'portaldetailmods-settings--imagemode'
        imagemodeselect.style.display = 'inline-block';
        imageoptionoriginal = imagemodeselect.appendChild(document.createElement('option'));
        imageoptionoriginal.textContent = 'Ingress {REDACTED}';
        imageoptionoriginal.value = 'original';
        let imageoptionprime = imagemodeselect.appendChild(document.createElement('option'));
        imageoptionprime.textContent = 'Ingress Prime';
        imageoptionprime.value = 'prime';
        imagemodeselect.value = self.settings.imageMode;
        imagemodeselect.addEventListener('change', function() {
            self.settings.imageMode = this.value;
        });
        
//
// Author
//
        let author = container.appendChild(document.createElement('div'));
        author.className = self.id + 'author';
        author.innerHTML = self.title + ' version ' + self.version + ' by ' + self.author;

// Create and open the dialog
        dialog = window.dialog({
			html: container,
            title: 'PortalDetailMods',
            id: dialog_id,
            dialogClass: 'ui-dialog-portaldetailmods',
            position: {
                my: 'auto',
                at: 'auto',
                of: window
            },
            width: '400px',
            height: 'auto',
            buttons: 
                dialogButtons,
      	    closeCallback: function () {
		    	save_Settings();
                dialog_RemoveDialog(dialog_id);
	        }
        }).dialog('option', 'buttons', dialogButtons);
        dialog_AddDialog(dialog_id, dialog);
    }

//
//  List of Open Dialog Windows
//
    let dialog_OpenDialogs = [];
    function dialog_AddDialog(id, dialog) {
        dialog_OpenDialogs.push( {
            id: id,
            dialog: dialog
        });
    }

    function dialog_GetDialog(id) {
        let dialog = null;
        let index = dialog_OpenDialogs.findIndex(item => item.id === id);
        if (index > -1)
            dialog = dialog_OpenDialogs[index].dialog;
        return dialog;
    }

    function dialog_RemoveDialog(id) {
        let index = dialog_OpenDialogs.findIndex(item => item.id === id);
        if (index > -1)
            dialog_OpenDialogs.splice(index,1);
    }

//
//  Place Mods Graphics in Portal Details box
//        
    function update_PortalDetails(p) {
        mods = document.querySelectorAll('.mods span');
        if (mods) {
            Array.from(mods).map(el => {
                el.title = el.title.replace(/rare/g, "Rare");
                el.style = '';
                el.style.display = "inline-block";
                let key = (el.textContent.toUpperCase().replace(/ /g, '_'));
                if (key != '') {
                    let itemimage = document.createElement('img');
                    var image = mods_getImageByKey(key,self.settings.imageMode);
                    itemimage.src = image;
                    itemimage.style.width = "auto";
                    itemimage.style.height = "64px";
                    el.innerHTML = '';
                    el.appendChild(itemimage);
                }
            });
        }
	}

//
// LocalStorage Related Functions
//    
    function localStorage_Init() {
        if (!localStorage[KEY_SETTINGS]) {
            localStorage[KEY_SETTINGS] = JSON.stringify({
		        settings: [],
            });
        }
    }

    function load_Settings() {
        let localData = localStorage[KEY_SETTINGS];
        if (!localData || localData == "") return;
        localData = JSON.parse(localData);
        if (!(localData instanceof Object)) return;
        if ('settings' in localData && localData.settings instanceof Object) {
            for (const key in self.settings) {
                if (key in localData.settings && typeof self.settings[key] == typeof localData.settings[key]) {
                    self.settings[key] = localData.settings[key];
                }
            }
        }
    };

    function save_Settings() {
		const ls = {};
		self.settings = self.settings; // Why?
		try {
			const localData = JSON.parse(localStorage[KEY_SETTINGS]);
		} catch (e) {}
		ls.settings = self.settings;
		localStorage[KEY_SETTINGS] = JSON.stringify(ls);
	}
//
// Main Setup Function
//
	self.setup = function() {
        if ('pluginloaded' in self) {
            console.log('IITC plugin already loaded: ' + self.title + ' version ' + self.version);
            return;
        } 
        else {
            self.pluginloaded = true;
        }

        localStorage_Init();

       	$('<a href="#" title="Shows Mod Pictures on Portal Detail">')
       		.text('PortalDetailMods')
       		.click(dialog_ShowSettings)
       		.appendTo($('#toolbox'));
        $("<style>")
            .prop("type", "text/css")
            .html(`

//
// Styles
// 
div#dialog-portaldetailmods {
    overflow-x: hidden !important;
}

.ui-dialog.ui-dialog-portaldetailmods {
    max-width: calc(100vw - 2px);
}

select {
    background-color: rgb(255,255,255);
}

/* Style the settings */
.settings {
    padding: 8px 8px;
    border: 1px solid #ffce00;
    background-color: rgba(8, 60, 78, 0.9);
    color: #ffce00;
    display: flex;
    flex-direction: column;
    flex: 1;
}
  
.settings label {
    border: none;
    margin-left: 0px;
    margin-right: 8px;
    background-color: rgba(8, 60, 78, 0.9);
    color: #ffce00;
}
  `).appendTo("head");

//
// Setup Function - Continued
//
        var sheet = document.createElement('style')
        sheet.innerHTML = '.' + self.id + 'author { margin-top: 14px; font-style: italic; font-size: smaller; }';
        document.body.appendChild(sheet);
        window.addHook('portalDetailsUpdated', update_PortalDetails);

        load_Settings();

        console.log('IITC plugin loaded: ' + self.title + ' version ' + self.version + " ");
    };

    var setup = function() {
        (window.iitcLoaded?self.setup():window.addHook('iitcLoaded',self.setup));
    };

    setup.info = plugin_info; //add the script info data to the function as a property
    if(!window.bootPlugins) window.bootPlugins = [];
    window.bootPlugins.push(setup);
    // if IITC has already booted, immediately run the 'setup' function
    if(window.iitcLoaded && typeof setup === 'function') setup();
} // wrapper end

// inject code into site context
var script = document.createElement('script');
var info = {};
if (typeof GM_info !== 'undefined' && GM_info && GM_info.script) info.script = { version: GM_info.script.version, name: GM_info.script.name, description: GM_info.script.description };
script.appendChild(document.createTextNode('('+ wrapper +')('+JSON.stringify(info)+');'));
(document.body || document.head || document.documentElement).appendChild(script);
